import React from 'react';
import  './App.css';



export default function App(){
    return(
        <>
        <div className="about">
        <h3>Hello My Name is Mo. Kaif Siddique</h3>
        <h1>I am Full Stack Web Developer , FrontEnd specialist </h1>
        <h2>Check out my portfolio and projects</h2>
        <h3>If you do like , contact me and let's work together</h3>
        </div>
        </>
    )
}
